+  BinaryJacksonCoder coder = new BinaryJacksonCoder(workers, validator);
+  connector.getFilterChain().addLast(
+   "codec",
+   new CQProtocolCodecFilter(new ChunkWriter(coder), new ChunkReader(coder))
